class Solution(object):
    def findMaximumNumber(self, k, x):
        """
        :type k: int
        :type x: int
        :rtype: int
        """
        def countSetBits(n):
            count = 0
            while n:
                count += n & 1
                n >>= 1
            return count

        def isValid(mid):
            total = 0
            for i in range(1, mid + 1):
                binary = bin(i)[2:]
                for j in range(len(binary)):
                    if (len(binary) - j) % x == 0 and binary[j] == '1':
                        total += 1
            return total <= k

        left, right = 1, 2
        while isValid(right):
            left = right
            right *= 2

        while left < right:
            mid = (left + right) // 2
            if isValid(mid):
                left = mid + 1
            else:
                right = mid

        return left - 1
